        // equal objects are not tested for reference equality
        Integer integer = new Integer(1);
        assertEquals(0, compare(integer, 1));

        int aByte = (byte) 5;
        int anotherByte = (byte) 5;
        assertEquals(0, compare(aByte, anotherByte));
    }
}

